import React from 'react';
import './slider.css';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.css';
import image01 from '../../../assets/img/common/NE@3x.png';

const Imageslider = () => {
  return (
    <Swiper 
      spaceBetween={50}
      slidesPerView={3}
      onSlideChange={() => console.log('slide change')}
      onSwiper={(swiper) => console.log(swiper)}
    >
      <SwiperSlide>
        <img src={image01} alt="Image 1" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 2" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 3" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 4" />
      </SwiperSlide>
     
    </Swiper>
  );
};

export default Imageslider;
